-- View structure for ro_address
-- ----------------------------
DROP VIEW IF EXISTS `ro_address`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `ro_address` AS SELECT `rp`.`province_id` AS `province_id`, `rc`.`city_id` AS `city_id`, `rs`.`subdistrict_id` AS `subdistrict_id`, `rs`.`subdistrict_name` AS `subdistrict_name`, `rc`.`city_name` AS `city_name`, `rp`.`province_name` AS `province_name`, concat(`rs`.`subdistrict_name`,',',`rc`.`city_name`,',',`rp`.`province_name`) AS `address` FROM ((`ro_subdistricts` `rs` join `ro_cities` `rc` on(`rc`.`city_id` = `rs`.`city_id`)) join `ro_provinces` `rp` on(`rp`.`province_id` = `rc`.`province_id`)) ; ;

